import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import { Routes, Route, Link, NavLink, BrowserRouter as Router, useNavigate, useParams, BrowserRouter } from 'react-router-dom';
import { Posts } from '.';
import './Message.css';

const Message = ({posts}) => {
    const navigate = useNavigate();

    return <>
        <div><h1>Contact</h1></div>
        <div> 
            <form>       
                <div className='sellerHeader'>Seller Username: ${posts.username}</div><input type='text' className='sellerName'></input>
                <input type='text' className='messageField' placeholder='Message text here'></input>
                <button type='submit'className='messageSubmit'>Submit</button>
            </form>
        </div>

        </>

}

export default Message;
